import React from 'react';

function BookDetails() {
  return (
    <div>
      <h2>Book Details</h2>
      <ul>
        <li>Title: React for Beginners</li>
        <li>Author: Dan Abramov</li>
        <li>Pages: 250</li>
      </ul>
    </div>
  );
}

export default BookDetails;
